import React from 'react';
import { useState } from 'react';
import './App.css';
import plantList from './datas/plantList';
import Pannier from './components/Pannier';
export default function App() {
  const [slct,setSlct]=useState()
  return (
    <div>
        <div id='bnr'><img src='logo.png' id='imglogo'/><span id='logo'>La maison jungle</span></div>
        <select onChange={(e)=>setSlct(e.target.value)}>
          {plantList.map((options,index)=>{
            return <option key={index+1} value={options.category}> {options}</option>
          })}
          
        </select>
     <Pannier/>
    </div>
  )
}
